import './TableFunc.css'

var columnHeaders = [];

function headerArrayCreator(){
    for (let i = 0; i < columnSize; i++) {
        if (i === 0)    
            columnHeaders.push("Parameters");
        else if (i === 1)
            columnHeaders.push("Weight (0-10)");
        else
            columnHeaders.push("Alternative " + (i - 1));
    }
}

function TableFunc(rowSize, columnSize) {
    console.log("column size is:" + columnSize);

    function headerCreator(){
        for(let i=0;i<columnHeaders.length;i++){
            <th>columnHeaders[i]</th>
        }
    }

    return(
        <div className="fiels">
            <table>
                <tr>
                    {headerCreator()}
                </tr>


            </table>
        </div>
    );
}

export default TableFunc;
